import {LOCALES} from '../locales';

export default{
    [LOCALES.CHINESE]:{
        'hello': '你好',
        'about': '关于我们',
        'cute': '可爱宠物是一个非营利性的社区组织，是一个注册的慈善组织，该组织执行新的动物保护法，并通过游说立法为寄养家庭提供服务，以改善被饲养的宠物的生活。',
        'ap': '领养手续',
    }
}
